if mibBuilder.loadTexts: win32ScheduledJobTable.setDescription('The Win32-ScheduledJob class represents a job scheduled using the NT schedule service. This class isonly instrumented on NT3.51 and upwards. Each job scheduled against the NT schedule service is stored persistently and is executed at the specified time and day of the week and/or month. If the machine is not active or if thescheduled service is not running at the specified job time the schedule service will run the specified job on thenext day at the specified time.Scheduled jobs are scheduled with respect to UTC time, i.e. with bias offset from GMT. This means that a job can bespecified using any time zone specification. The Win32-ScheduledJob class will return the local time with UTC offsetwhen enumerating object and convert to local time when creating new jobs. For example a job specified to run on a computer in Chicago at 10:30 pm Monday PST time will be scheduled to run locally at 12:30am Tuesday CET. It should be noted that a client must take into account whether daylight...')
