if mibBuilder.loadTexts: win32ScheduledJobDaysOfWeek.setDescription("DaysOfWeek represents what days of the week the job will be run on. If a Job has value null for both DaysOfWeek and DaysOfMonth,then the Job will be run either today or tomorrow depending on the specified StartTime and the current local time i.e. if it is12:30am and the job was created at 12:31am then the job will be run the following day.The value is a bitmask representing the day of the week, Sunday is specified as bit 0 and Saturday as bit 6. Each day can beinclusively Or'd to form a 7 bit value indicating the days of the week to run the job.")
win32ScheduledJobDaysOfMonth = MibTableColumn((1, 3, 6, 1, 4, 1, 2, 6, 159, 1, 2, 10, 450, 1, 8), Uint32()).setMaxAccess("readwrite")
